// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.21;

contract Election {
    address public admin;
    uint256 candidateCount;
    uint256 voterCount;
    bool start;
    bool end;

    constructor(address _admin) {
        admin = _admin;
        candidateCount = 0;
        voterCount = 0;
        start = false;
        end = false;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only the admin can perform this action.");
        _;
    }

    struct Candidate {
        uint256 candidateId;
        string header;
        string slogan;
        uint256 voteCount;
    }

    mapping(uint256 => Candidate) public candidateDetails;

    function addCandidate(string memory _header, string memory _slogan)
        public
        onlyAdmin
    {
        Candidate memory newCandidate = Candidate({
            candidateId: candidateCount,
            header: _header,
            slogan: _slogan,
            voteCount: 0
        });
        candidateDetails[candidateCount] = newCandidate;
        candidateCount += 1;
    }

    struct ElectionDetails {
        string adminName;
        string adminEmail;
        string adminTitle;
        string electionTitle;
        string organizationTitle;
        bool isActive;
    }

    ElectionDetails[] public elections;

    function setElectionDetails(
        string memory _adminName,
        string memory _adminEmail,
        string memory _adminTitle,
        string memory _electionTitle,
        string memory _organizationTitle
    )
        public
        onlyAdmin
    {
        ElectionDetails memory newElection = ElectionDetails({
            adminName: _adminName,
            adminEmail: _adminEmail,
            adminTitle: _adminTitle,
            electionTitle: _electionTitle,
            organizationTitle: _organizationTitle,
            isActive: true
        });
        elections.push(newElection);
        start = true;
        end = false;
    }

    function getElectionDetails(uint256 electionIndex)
        public
        view
        returns (string memory adminName,
                 string memory adminEmail,
                 string memory adminTitle,
                 string memory electionTitle,
                 string memory organizationTitle,
                 bool isActive)
    {
        ElectionDetails storage election = elections[electionIndex];
        return (
            election.adminName,
            election.adminEmail,
            election.adminTitle,
            election.electionTitle,
            election.organizationTitle,
            election.isActive
        );
    }

    function getTotalElections() public view returns (uint256) {
        return elections.length;
    }

    function getTotalCandidate() public view returns (uint256) {
        return candidateCount;
    }

    function getTotalVoter() public view returns (uint256) {
        return voterCount;
    }

    struct Voter {
        address voterAddress;
        string name;
        string phone;
        bool isVerified;
        bool hasVoted;
        bool isRegistered;
    }

    address[] public voters;
    mapping(address => Voter) public voterDetails;

    function registerAsVoter(string memory _name, string memory _phone) public {
        require(voterDetails[msg.sender].isRegistered == false, "You are already registered.");

        Voter memory newVoter = Voter({
            voterAddress: msg.sender,
            name: _name,
            phone: _phone,
            hasVoted: false,
            isVerified: false,
            isRegistered: true
        });
        voterDetails[msg.sender] = newVoter;
        voters.push(msg.sender);
        voterCount += 1;
    }

    function verifyVoter(bool _verifiedStatus, address voterAddress)
        public
        onlyAdmin
    {
        voterDetails[voterAddress].isVerified = _verifiedStatus;
    }

    function vote(uint256 candidateId) public {
        require(voterDetails[msg.sender].hasVoted == false, "Already voted");
        require(voterDetails[msg.sender].isVerified == true, "Not verified");
        require(start == true, "Election not started");
        require(end == false, "Election ended");

        candidateDetails[candidateId].voteCount += 1;
        voterDetails[msg.sender].hasVoted = true;
    }

    function endElection(uint256 electionIndex) public onlyAdmin {
        elections[electionIndex].isActive = false;
        end = true;
        start = false;
    }

    function removeElection(uint256 electionIndex) public onlyAdmin {
        require(!elections[electionIndex].isActive, "Election is still active");

        for (uint i = electionIndex; i < elections.length - 1; i++) {
            elections[i] = elections[i + 1];
        }
        elections.pop();
    }

    function resetElection() public onlyAdmin {
        require(end == true, "Election is not yet over");

        for (uint256 i = 0; i < candidateCount; i++) {
            delete candidateDetails[i];
        }
        candidateCount = 0;

        for (uint256 i = 0; i < voters.length; i++) {
            delete voterDetails[voters[i]];
        }
        delete voters; // ✅ Corrected line to reset the array
        voterCount = 0;

        start = false;
        end = false;
    }

    function getStart() public view returns (bool) {
        return start;
    }

    function getEnd() public view returns (bool) {
        return end;
    }
}
